import './style/header.css';
import logoWhite from './img/logo_white.png';

const MenuItem = ({ href, children, subItems }) => (
  <li>
    <a href={href}>{children}</a>
    {subItems && (
      <ul className="head-sub-menu">
        {subItems.map((item, index) => (
          <MenuItem key={index} href={item.href} subItems={item.subItems}>
            {item.label}
          </MenuItem>
        ))}
      </ul>
    )}
  </li>
);

export function Header() {
  const mainMenuItems = [
    {
      label: '회사소개',
      href: './index.html',
      subItems: [
        { label: '회사소개'+<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-chevron-down" viewBox="0 0 16 16">
          <path fill-rule="evenodd" d="M1.646 4.646a.5.5 0 0 1 .708 0L8 10.293l5.646-5.647a.5.5 0 0 1 .708.708l-6 6a.5.5 0 0 1-.708 0l-6-6a.5.5 0 0 1 0-.708"/>
        </svg>
        , href: './sub-page1-1-1.html', subItems: [
            { label: '회사소개 스타일1', href: './sub-page1-1-1.html' },
            { label: '회사소개 스타일2', href: './sub-page1-1-2.html' },
            { label: '회사소개 스타일3', href: './sub-page1-1-3.html' }
          ]
        },
        { label: '회사비전', href: './sub-page1-2-1.html', subItems: [
            { label: '회사비전 스타일1', href: './sub-page1-2-1.html' },
            { label: '회사비전 스타일2', href: './sub-page1-2-2.html' }
          ]
        },
        { label: '회사연혁', href: '#' },
        { label: '조직소개', href: '#' },
        { label: '오시는 길', href: '#' }
      ]
    },
    {
      label: '제품서비스',
      href: './productPage.html',
      subItems: [
        { label: '서비스소개', href: './productPage.html', subItems: [
            { label: '서비스소개 스타일1', href: './productPage.html' },
            { label: '서비스소개 스타일2', href: './productPage_1_2.html' },
            { label: '서비스소개 스타일3', href: '#' }
          ]
        },
        { label: '제품안내', href: './productPage_2_1.html', subItems: [
            { label: '제품안내 스타일1', href: '#' }
          ]
        }
      ]
    },
    {
      label: '갤러리',
      href: './gallery.html',
      subItems: [
        { label: '갤러리 스타일1', href: './gallery.html' },
        { label: '갤러리 스타일2', href: './gallery.html' },
        { label: '갤러리 스타일3', href: './gallery.html' }
      ]
    },
    {
      label: '뉴스센터',
      href: './newsPage_11.html',
      subItems: [
        { label: '고객센터', href: './newsPage_11.html' },
        { label: '미디어', href: '#' },
        { label: '자주묻는 질문', href: '#' },
        { label: 'Contact Us', href: '#' }
      ]
    }
  ];

  return (
    <>
      <header>
        <nav>
          <div className="top">
            <ul className="top-menu">
              <li><a href="#">연구센터</a></li>
              <li><a href="#">소식마당</a></li>
              <li><a href="#">로그인</a></li>
            </ul>
          </div>

          <div className="head">
            <div className="logo">
              <a href="./index.html">
                <img src={logoWhite} alt="logo" />
              </a>
            </div>

            <div className="head-menu">
              <ul className="head-main-menu">
                {mainMenuItems.map((item, index) => (
                  <MenuItem key={index} href={item.href} subItems={item.subItems}>
                    {item.label}
                  </MenuItem>
                ))}
              </ul>

              <ul className="icon">
                <li>
                  <a id="search" href="#">
                    <img src="https://mwpdemo12348.mycafe24.com/wp-content/themes/ktheme_biz_fabric/images/icon_search.svg" alt="" />
                    <img src="https://mwpdemo12348.mycafe24.com/wp-content/themes/ktheme_biz_fabric/images/icon_search_black.svg" alt="" />
                  </a>
                </li>
                <li>
                  <a href="#">
                    <img src="https://mwpdemo12348.mycafe24.com/wp-content/themes/ktheme_biz_fabric/images/icon_full_menu.svg" alt="" />
                    <img src="https://mwpdemo12348.mycafe24.com/wp-content/themes/ktheme_biz_fabric/images/icon_full_menu_black.svg" alt="" />
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <div className="head-search">
          <input className="head-search-bar" type="text" name="s" placeholder="검색하기" />
        </div>

        <div className="head-toggle-menu"></div>
      </header>

      <div className="title-page">
        <div id="main-title-area">
          <h1 id="main-title1" className="main-title">
            Electronic Data Research Center
            <span style={{ borderTop: '3px solid white' }}>er</span>
          </h1>
          <h3 id="main-title2" className="main-title">
            EDRC는 대한민국의 데이터 산업의 기틀을 마련하기 위한 기틀을 마련합니다
          </h3>
        </div>
      </div>


    </>
  );
}
